var first = $('.first-screen');
var second = $('.second-screen');
var back = $('.order__to-left');
var next = $('.hided');
var form = false;
var win = 'first';
console.log(status);

$('.first-screen input').on('keydown', function () {
    checkInputs();
    slideWin();
    Copy();
    if (form === true && win === 'first') {
        next.fadeIn();
    }
});
function checkInputs() {
    var j = 0;
    first.find('input').map(function (currentValue, index, array) {
        if ($(index).val()) j++;
        (j === first.find('input').length) ? form = true : form = false;
    })
}
function slideWin() {
    next.on('click', function () {
        event.preventDefault();
        first.hide(400);
        second.show(400);
        win = 'second';
        if (win === 'second') {
            back.fadeIn(400);
            next.fadeOut(400);
        }
    });
    back.on('click', function () {
        second.hide(400);
        first.show(400);
        win = 'first';
        if (win === 'first') {
            next.fadeIn(400);
            back.fadeOut(400);
        }
    })
}
function Copy() {
    first.find('input').map(function (currentValue, index, array) {
        var name = $(index).attr('name');
        var newForm = second.find('input[name="' + name + '"]');
        $(newForm).val($(index).val());
    })
}


